con:config.script:
//Set Property at Projectlevel


testRunner.testCase.testSuite.project.setPropertyValue("countryname", "IN");

def projectLevel = testRunner.testCase.testSuite.project.getPropertyValue("countryname")
log.info("Project Level Property: " +"$projectLevel")

//Set Property at TestSuite Level

testRunner.testCase.testSuite.setPropertyValue("NameOfCountry","USA");
def TestSuitLevel = testRunner.testCase.testSuite.getPropertyValue("NameOfCountry")
log.info("Test Suite Leavel Property :" +TestSuitLevel)

//Delete ProjectLevel Property
log.info("Deleting Project level Property")
testRunner.testCase.testSuite.project.removeProperty("countryname")
def projectLevelProperty = testRunner.testCase.testSuite.project.getPropertyValue("countryname")
log.info("Project Level Property: " +"$projectLevelProperty")

//Set Property at TestCase Level

testRunner.testCase.setPropertyValue("CountryName","UK");
def TestCaseLevel = testRunner.testCase.getPropertyValue("CountryName")
log.info("Test Case Level Property :" +TestCaseLevel)

testRunner.testCase.getTestStepByName("TestStepProperties").setPropertyValue("NameTheCountry","AUS")
